  public class FunctorHlp
  {
    public static T Execute<T>(Getter<T> getter)
    {
      if (getter == null)
        return default(T);
      return getter();
    }
    public static T SafeExecute<T>(Getter<T> getter, bool isTrace)
    {
      try
      {
        return Execute<T>(getter);
      }
      catch (Exception exc)
      {
        if (isTrace)
          System.Diagnostics.Trace.WriteLine(exc);
      }
      return default(T);
    }
  }

  /// <summary>
  /// Устарел: Используйте FunctorHlp
  /// </summary>
  [Obsolete("Используйте FunctorHlp")]
  public class GetterHlp
  {
    public static T Execute<T>(Getter<T> getter)
    {
      if (getter != null)
        return getter();
      return default(T);
    }
  }

